import { Button, Card } from "@mantine/core";
import React from "react";
import './Page.css';

function pending()
{
    return(
        <>
        <a className="corner_button" onClick={()=>{console.log('Hello world')}}>+ ADD</a>
        </>
    )
}

function Cart()
{
    return(
        <div>
        <Button className="Cart_Button">Bought</Button>
        <Button className="Cart_Button">Pending</Button>
        <Card className="Cart_card" withBorder>
            {pending()}        
        </Card>
        </div>
    )
}

export default Cart
